@EU_Commission Helping refugees is also part of winning the war. Thanks, we can see.
My only hope is not to let all this pain go to waste with the arrival of peace.
The Iron Curtain must be lowered against dictators! No more blood transfusions for them! Don't be an accomplice of dictatorship!

@EU_Commission Little numbers of GIZ PCP facilitators have received 🇩🇪 approvals and have been transferred to 🇩🇪.
But most of us are still like prisoners.
Our confirmation &amp; evacuation process is very slow, please speed up our confirmation &amp; evacuation process
@ABaerbock @NancyFaeser @BMZ_Bund
